import React from 'react'
import ArtData from '../assets/_legacy-art.json'
import FeatureCard from '../components/FeatureCard'

function SearchGrid() {
    {console.log(ArtData.map((data)=>{return data.properties.image}))}
  return (
    <div className="container m-5 d-flex b-1 flex-wrap ">

         {ArtData.map((data, key) => {
             {console.log("data",data,key)}
                return <FeatureCard imgAddr={data.properties.image}  title={data.properties.title} />;
            })} 
    </div>
  )
}

export default SearchGrid
